import http from "../http-common";

const getAll = ()=>{
    return http.get("/User")
}

const get = id_User =>{
    return http.get(`/User/${id_User}`);
};

const create = data => {
    return http.post("/User",data);
};

const update =(id_User, data)=>{
    return http.put(`/User`,data);
};

const remove = id_User => {
    return http.delete(`/User/${id_User}`);
};

const UserServices = {
    getAll,
    get,
    create,
    update,
    remove
};
export default UserServices;
